import React from 'react';
import styled from 'styled-components';

const UploadPageContainer = styled.div`
    display: flex;
    height: 100vh;
    padding: 20px;
`;

const LeftPanel = styled.div`
    flex: 1;
    display: flex;
    flex-direction: column;
    padding: 20px;
    background-color: #f4f4f4;
    border-right: 1px solid #ddd;
`;

const RightPanel = styled.div`
    flex: 2;
    padding: 20px;
    display: flex;
    flex-direction: column;
`;

const Section = styled.div`
    margin-bottom: 20px;
`;

const Title = styled.h2`
    margin-bottom: 10px;
`;

const Button = styled.button`
    padding: 10px 20px;
    margin-top: 10px;
    background-color: #28a745;
    color: white;
    border: none;
    border-radius: 5px;
    cursor: pointer;

    &:hover {
        background-color: #218838;
    }
`;

const UploadPage = () => {
    return (
        <UploadPageContainer>
            <LeftPanel>
                <Section>
                    <Title>Personal Info</Title>
                    {/* Add personal info details */}
                </Section>
                <Section>
                    <Title>Previous Reports</Title>
                    {/* Add previous reports list */}
                </Section>
                <Section>
                    <Title>Previous Submissions</Title>
                    {/* Add previous submissions list */}
                </Section>
                <Section>
                    <Title>Submit GitHub Repository</Title>
                    {/* Add GitHub repository submission form */}
                </Section>
            </LeftPanel>
            <RightPanel>
                <Section>
                    <Title>Report Resolve</Title>
                    {/* Add report resolve information */}
                </Section>
                <Section>
                    <Title>Current Projects</Title>
                    {/* Add current projects list */}
                </Section>
                <Section>
                    <Title>Upload APK for Analysis</Title>
                    <input type="file" accept=".apk" />
                    <Button>Check Vulnerabilities</Button>
                    <ul>
                        <li>Static Analysis</li>
                        <li>Configuration Analysis</li>
                        <li>External Dependencies</li>
                    </ul>
                </Section>
            </RightPanel>
        </UploadPageContainer>
    );
};

export default UploadPage;
